import { createMuiTheme } from "@material-ui/core/styles";

const fixBlue = "#0B72B9";
const fixOrange = "#FFBA60";

export default createMuiTheme({
  palette: {
    common: {
      fixBlue: `${fixOrange}`,
      fixOrange: `${fixOrange}`,
    },
    primary: {
      main: `${fixOrange}`,
    },
    secondary: {
      main: `${fixOrange}`,
    },
  },
});
